  "image_type": "diagrama",
  "short_description": "Diagrama de união mística ou casamento forçado no Human Design.",
  "summary": "A imagem apresenta três diagramas triangulares representando o Design, a Personalidade e o Quantum no sistema de Human Design. Cada diagrama é preenchido com símbolos, números e linhas que conectam diferentes pontos, indicando a interação entre os centros de energia. O diagrama do Design à esquerda mostra uma configuração específica de centros ativados e não ativados, com linhas vermelhas e pretas indicando conexões e influências. O diagrama da Personalidade à direita apresenta uma configuração diferente, com linhas pretas e vermelhas mostrando outra configuração de centros e conexões. O diagrama do Quantum no centro combina elementos dos dois, ilustrando uma união mística ou um casamento forçado entre o Design e a Personalidade. Os números e símbolos ao lado de cada diagrama fornecem informações adicionais sobre os centros de energia e suas interações, destacando a complexidade e a interconexão dos sistemas de Design e Personalidade no Human Design."
}
